window.bookSummaryJSON = "<p><b>A mother’s unthinkable crime and an investigator’s forgotten past collide in a shocking novel of suspense by Anne Frasier, the </b><b><i>New York Times</i></b><b> bestselling author of </b><b><i>The Body Reader</i></b><b>.</b></p> <p>Private detective Olivia Welles hasn’t been to her hometown since her childhood, not since the night she died. She has no memory of the world before the car crash or of coming back to life in the morgue. But now, years later, when fellow survivor Bonnie Ray calls from a Kansas jail begging for help, Olivia feels the tug of a dark and unremembered past.</p> <p>Bonnie looks guilty of murdering her young son—Bonnie’s third child to die under suspicious circumstances. Intrigued and seeking closure, Olivia agrees to investigate.</p> <p>Back in the foreboding town where her heart stopped and started again, Olivia finds an unexpected ally in Will LaFever, a journalist with his own motives for uncovering the truth. Together they unearth more than they expect about Bonnie, her traumatized family, and the crime.</p> <p><i>You’re lucky you don’t remember any of it,</i> Olivia’s father used to say. But Olivia’s luck is running out. This time, escaping Finney County with her life might be impossible.</p>"; 
